import './App.css';
import UserItem from './components/UserItem';
import {
  BrowserRouter,
  Routes,
  Route
} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <UserItem/>
      <BrowserRouter>
        <Routes>
          <Route exact path="/cover" element={<UserDetailCover username={name} pass={password}></UserDetailCover>}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
